window.bookSummaryJSON = "<p>I'm a prisoner in the Unseelie world. The bars of my prison my portal to home. The Queen of Air and Darkness my judge, jury...and executioner. </p> <p>I must pay for my crimes, she tells me - for all my sins. And while I wait in this cold, dark Hell, my father has the real murderer, the Unseelie Prince, Absolon. Lucifer won't hurt him, even when Absolon laughs in his face. For my life hangs in the balance....</p> <p>But was this all part of the Queen's master plan? A plan to make me hurt. A plan to make me pay...and to force to his knees the one who got away - Redemption. </p> <p>He will beg for her mercy. He will stand bare for her cruel gaze. Will do it all...and he'll do it for me. </p> <p>We'll fight with all we have. We'll hold each other close. And pray we survive. </p> <p><i>Contains mature themes.</i></p>"; 
